import axios from 'axios';
import React, { useState, useEffect } from 'react';

function App() {
  const [details, setDetails] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000') 
      .then(res => {
        setDetails(res.data);
      })
      .catch(err => console.error("Error fetching data:", err));
  }, []);

  return (
    <div>

    </div>
  );
}

export default App;
